import React, { Component } from 'react'

class Task extends Component {
    render() {
        return (
            <div className="Task">
                <span
                    style={{ textDecoration: this.props.propsToTask.done ? 'line-through' : 'none' }}
                >
                    {this.props.propsToTask.value}
                </span>
                <button>
                    {this.props.propsToTask.done ? 'Undo' : 'Tapos na' }
                </button>
            </div>
        )
    }
}

export default Task;
